import Posts from './components/Posts'

import { useQuery } from '@apollo/react-hooks'
import { POST_LIST_QUERY } from './query'

function App () {
  const { data } = useQuery(POST_LIST_QUERY)

  return (
    <div className="App">
      <Navbar />
      <Posts />
    </div>
  );
}

export default App;
